selector_to_html = {"a[href=\"#faktorisering-og-kvadratkomplettering\"]": "<h1 class=\"tippy-header\" style=\"margin-top: 0;\"><span class=\"section-number\">1.5. </span>Faktorisering og kvadratkomplettering<a class=\"headerlink\" href=\"#faktorisering-og-kvadratkomplettering\" title=\"Permalink til denne overskrift\">#</a></h1><p>To vigtige discipliner, som du skal blive komfortabel med er <em>faktorisering</em> og <em>kvadratkomplettering</em>. Du har allerede st\u00f8dt p\u00e5 begrebet faktorisering i <a class=\"reference internal\" href=\"regnearterne.html#regnearterne\"><span class=\"std std-numref\">Kapitel 1.3</span></a>. Kvadratkomplettering er egentlig ogs\u00e5 faktorisering, som du vil se, men metoden er s\u00e5 vigtig, at vi tildeler emnet et kapitel for sig selv.</p>", "a[href=\"regnearterne.html#regnearterne\"]": "<h1 class=\"tippy-header\" style=\"margin-top: 0;\"><span class=\"section-number\">1.3. </span>Regnearterne<a class=\"headerlink\" href=\"#regnearterne\" title=\"Permalink til denne overskrift\">#</a></h1><p>Du kender dem allerede. Vi har fire grundl\u00e6ggende regnearter eller regneoperationer, nemlig</p>", "a[href=\"kvadratsaetninger.html#k1\"]": "<div class=\"proof s\u00e6tning admonition\" id=\"k1\">\n<p class=\"admonition-title\"><span class=\"caption-number\">S\u00e6tning 1.3 </span> (1. kvadrats\u00e6tning)</p>\n<section class=\"s\u00e6tning-content\" id=\"proof-content\">\n<p>Lad <span class=\"math notranslate nohighlight\">\\(a\\)</span> og <span class=\"math notranslate nohighlight\">\\(b\\)</span> v\u00e6re vilk\u00e5rlige tal, da g\u00e6lder f\u00f8lgende identitet:</p>\n<div class=\"math notranslate nohighlight\">\n\\[    (a+b)^2 = a^2 + b^2 + 2ab\n    \\tag{K1} \\]</div>\n</section>\n</div>", "a[href=\"#opgaver\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\"><span class=\"section-number\">1.5.3. </span>Opgaver<a class=\"headerlink\" href=\"#opgaver\" title=\"Permalink til denne overskrift\">#</a></h2>", "a[href=\"#kvadratkomplettering\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\"><span class=\"section-number\">1.5.2. </span>Kvadratkomplettering<a class=\"headerlink\" href=\"#kvadratkomplettering\" title=\"Permalink til denne overskrift\">#</a></h2><p>Kvadratkomplettering er egentlig en direkte overs\u00e6ttelse af det engelske begreb \u00bbcompleting the squares\u00ab. Vi introducerer begrebet her, selvom det f\u00f8rst viser sin s\u00e6rlige anvendelighed, n\u00e5r vi skal arbejde med andengradspolynomier. L\u00e6ser vi <a class=\"reference internal\" href=\"kvadratsaetninger.html#k1\">1. kvadrats\u00e6tning</a>, s\u00e5 kan vi l\u00e6se identiteten som <span class=\"math notranslate nohighlight\">\\((a+b)^2\\)</span> er lig med <span class=\"math notranslate nohighlight\">\\(a^2 + b^2 + 2ab\\)</span>, men vi kan ogs\u00e5 l\u00e6se den omvendt, nemlig <span class=\"math notranslate nohighlight\">\\(a^2 + b^2 + 2ab\\)</span> er lig med <span class=\"math notranslate nohighlight\">\\((a+b)^2\\)</span>. Det er netop id\u00e9en med kvadratkomplettering. Vi vil alts\u00e5 omskrive udtryk s\u00e5dan, at vi kan identificerer kvadratet p\u00e5 et led, kvadratet p\u00e5 et andet led og eventuelt det dobbelte produkt og dern\u00e6st bruge den tilh\u00f8rende kvadrats\u00e6tning til omskrivningen.</p><p>Vi vil arbejde med udtryk, hvor vi direkte kan bruge en af kvadrats\u00e6tningerne, men vi vil ogs\u00e5 m\u00f8de udtryk, hvor vi bliver n\u00f8dt til at l\u00e6gge \u00bb0\u00ab til. Det lyder umiddelbart m\u00e6rkeligt, at vi skal l\u00e6gge \u00bb0\u00ab til. Men, det er faktisk en meget anvendelig teknik, som benyttes i mange elementer af matematikken. Vi vil st\u00f8de p\u00e5 denne teknik i senere kapitler ogs\u00e5.</p>", "a[href=\"kvadratsaetninger.html#k2\"]": "<div class=\"proof s\u00e6tning admonition\" id=\"k2\">\n<p class=\"admonition-title\"><span class=\"caption-number\">S\u00e6tning 1.4 </span> (2. kvadrats\u00e6tning)</p>\n<section class=\"s\u00e6tning-content\" id=\"proof-content\">\n<p>Lad <span class=\"math notranslate nohighlight\">\\(a\\)</span> og <span class=\"math notranslate nohighlight\">\\(b\\)</span> v\u00e6re vilk\u00e5rlige tal, da g\u00e6lder f\u00f8lgende identitet:</p>\n<div class=\"math notranslate nohighlight\">\n\\[    (a-b)^2 = a^2 + b^2 - 2ab\n    \\tag{K2} \\]</div>\n</section>\n</div>", "a[href=\"#faktorisering\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\"><span class=\"section-number\">1.5.1. </span>Faktorisering<a class=\"headerlink\" href=\"#faktorisering\" title=\"Permalink til denne overskrift\">#</a></h2><p>Faktorisering er et begreb, der d\u00e6kker over, at vi kan nedbryde et matematisk udtryk til faktorer, der ganget sammen, giver det oprindelige udtryk. Ved blot at betragte et udtryk, s\u00e5 kan vi nogen gange v\u00e6re heldig at se, at nogen af leddene i udtrykket har noget til f\u00e6lles, som vi netop kan \u00bbfaktorisere ud\u00ab. Kig for eksempel p\u00e5 udtrykket</p>"}
skip_classes = ["headerlink", "sd-stretched-link"]

window.onload = function () {
    for (const [select, tip_html] of Object.entries(selector_to_html)) {
        const links = document.querySelectorAll(` ${select}`);
        for (const link of links) {
            if (skip_classes.some(c => link.classList.contains(c))) {
                continue;
            }

            tippy(link, {
                content: tip_html,
                allowHTML: true,
                arrow: true,
                placement: 'auto-start', maxWidth: 500, interactive: false,
                onShow(instance) {MathJax.typesetPromise([instance.popper]).then(() => {});},
            });
        };
    };
    console.log("tippy tips loaded!");
};
